    style='font-size:18.0pt;line-height:107%;mso-ansi-language:EN-US'> <span
    class=SpellE>si</span> Zedrick S. <span class=SpellE>Laurora</span>, ang <span
    class=SpellE>paborito</span> <span class=SpellE>kong</span> sports ay
    basketball at <span class=SpellE>naging</span> varsity ng <span
    class=SpellE>Mambugan</span> National High School. At <span class=SpellE>hilig</span>
    ko ay mag <span class=SpellE>laro</span> ng online games at mag basketball <span
    class=SpellE>dahil</span> <span class=SpellE>dito</span> <span
    class=SpellE>nalilibang</span> ko ang <span class=SpellE>aking</span> <span
    class=SpellE>sarili</span> <span class=SpellE>sa</span> <span class=SpellE>mga</span>

    class=SpellE>pagkain</span> ay sinigang <span class=SpellE>na</span> <span
    class=SpellE>hipon</span> at <span class=SpellE>mga</span> seafood <span
    class=SpellE>nakatira</span> <span class=SpellE>ako</span> <span
    class=SpellE>sa</span> <span class=SpellE>pagrai</span> unit 5 Antipolo City.<o:p></o:p></span></p>
